import React from "react";

const ConfigTop = () => {
  return (
    <div className="configTop">
      <div className="fileConfigHeadBox d-flex justify-content-between align-items-center">
        <h5 className="fontWeight-600 fileConfigHead colorBlack">
          File Configuration
        </h5>
      </div>

      <div className="configTopContent">
          <div className="configTopLeftBox"></div>
          <div className="configTopRightBox"></div>
      </div>
    </div>
  );
};

export default ConfigTop;
